<?xml version="1.0" encoding="UTF-8"?>
<?framexs.target http://www.w3.org/2001/XMLSchema?>
<html xmlns="http://www.w3.org/1999/xhtml" prefix="og: http://ogp.me/ns#" xmlns:framexs="urn:framexs">
	<head>
		<framexs:apply src="head.fragment.xml"/>
	</head>
	<body>
        <framexs:apply src="header.fragment.xml"/>
		<div>
		<framexs:root>
			<div>
				groupId:<framexs:for-element name="groupId"><framexs:text/></framexs:for-element><br/>
				artifactId<framexs:for-element name="artifactId"><framexs:text/></framexs:for-element>
			</div>                                           
			<framexs:for-element name="dependencies">
				<h2>dependencies</h2>
				<framexs:for-element name="dependency">
					<div>
					<framexs:for-element name="groupId">
						<framexs:text/>
					</framexs:for-element>:
					<framexs:for-element name="artifactId">
						<framexs:text/>
					</framexs:for-element>:
					<framexs:for-element name="version">
						<framexs:text/>
					</framexs:for-element>
					</div>
				</framexs:for-element>
			</framexs:for-element>
			<framexs:for-element name="dependencyManagement">
				<h2>dependencyManagement</h2>
				<framexs:for-element name="dependencies">
					<h3>dependencies</h3>
					<framexs:for-element name="dependency">
						<div>
							<framexs:for-element name="groupId">
								<framexs:text/>
							</framexs:for-element>:
							<framexs:for-element name="artifactId">
								<framexs:text/>
							</framexs:for-element>:
							<framexs:for-element name="version">
								<framexs:text/>
							</framexs:for-element>
						</div>
					</framexs:for-element>
				</framexs:for-element>
			</framexs:for-element>
			<framexs:for-element name="profiles">
				<framexs:for-element name="profile">
				</framexs:for-element>
			</framexs:for-element>
			<framexs:for-element name="build">
				<framexs:for-element name="pluginManagement">
					<framexs:for-element name="plugin">
						<framexs:for-element name="groupId">
							<framexs:text/>                 
						</framexs:for-element>:
						<framexs:for-element name="artifactId">
							<framexs:text/>
						</framexs:for-element>:
						<framexs:for-element name="version">
							<framexs:text/>
						</framexs:for-element>
					</framexs:for-element>
				</framexs:for-element>
				<framexs:for-element name="plugins">
				</framexs:for-element>
			</framexs:for-element>
		</framexs:root>
		</div>
	</body>
</html>
